import React from "react"
import ExpenseForm from "./ExpenseForm"

const AddNewExpense = () => {
    const generateForm = () => {
        return <ExpenseForm/>
    } 

    return (
    <button className='new-expense__actions' type='submit'
    onSubmit={generateForm}>Add New Expense</button>
    )
}

export default AddNewExpense
